import { Route, Switch } from 'react-router';
import './App.css';
import SignupPage from './pages/privado/SignupPage';

function App() {
  return (
    <div className="App">
    <Switch>
      <Route path="/sistemas/novo-funcionario" render={()=>SignupPage}/>
    </Switch>
    </div>
  );
}

export default App;
